 import React from "react";
import { connect } from "react-redux";

 const TodoList = (props) => {
     return(
         <div>
            { props.todo.map((todo) => (
                <p>{todo.title}</p>
            )) }
        </div>
     );
 };

 const mapStateToprops = state => ({
     todos: state.todos.allTodos
 });

 export default connect(mapStateToprops)(TodoList);
